B.Hk=A.b(s(["You take all philosophies in.","You will evaluate what is best for you.","You would be loyal to your philosophical beliefs and would very strongly stay loyal to your code of ethics.","You are permissive in all areas of your life."]),t.s)
B.Hr=A.b(s(["You have abstract philosophical imagination and religious beliefs."]),t.s)
B.HM=A.b(s(["My analysis found that you are an incredibly goal-oriented person.","You're very practical in your approach, needing to visualize the end of a project before even starting.","Everything is planned out in advance, and you find real joy in anticipating what\u2019s to come.","It's like you have everything mapped out for yourself."]),t.s)
B.Hs=A.b(s(["Pride is something a person feels. It can produce a feeling of elation.","Pride governs a person's attitude towards others."]),t.s)
B.Hg=A.b(s(["You don't dig very deep into anything on first thought.",'You might think it to be a negative trait. But, it would be very surprising for you to know that most of the top executives have shallow thinking as they do not have time to dig deeper into anything. As the investigation and analysis are done by others, you are only required to say, "Yes / No" for it.']),t.s)
B.FP=A.b(s(["You tend to stay close to the line of reality.","You inquire or investigate just enough to satisfy your desires and are not inclined to dig very deeply into any subject.","Often, you take others' words as fact without much further scrutiny."]),t.s)
B.G_=A.b(s(["You tend to hold onto what is yours.","You will cling to your ideas & beliefs or you will be tenacious about materialistic things."]),t.s)
B.EC=A.b(s(["You have eyes on the clouds and may tend to trip over a rock and fall.","You have something new to work on every time.","You dream the impossible dreams.","This trait is an ingredient of success.","Dreaming is not a negative trait, however, if you dream and take no action toward making those dreams a reality, much of the value is lost."]),t.s)
B.He=A.b(s(["You have an over-growth of pride.","You show an indication of Strong self-love.","Also called as 'Egotism'.","Vanity in the company of willpower, high goals, enthusiasm, determination, persistence, and attention to detail would be a positive spur to achievement."]),t.s)
B.G7=A.b(s(['An anti-social trait in handwriting can be like a "thorny fence" \ud83c\udf35 around your inner world.',"Just as sharp thorns keep others at a distance, you push people away, as you don\u2019t trust them.","You rarely let people close enough to know you.","Fears getting hurt emotionally.","This trait is a roadblock to intimacy."]),t.s)
B.ED=A.b(s(["You may not intend to deceive or mislead. You take a grain of truth and blow it away out of proportion.","Your imagination exaggerates everything you observe. However, you don't consider that you're lying."]),t.s)
B.HN=A.b(s(["Generosity towards others to self:\n    \u25ab Generosity is understood in terms of money, time, and space.\n    \u25ab Generosity is basically giving it away without expecting anything in return. It is pure selflessness."]),t.s)
B.Gs=A.b(s(["You use your imagination to understand.","You use your imagination for constructive purposes.","Even the driest subject can be explained to you, as you apply your imagination to understand it.","Imagination can be a very good strength if you know how to use it."]),t.s)
B.FC=A.b(s(["You will get bored easily and need variety in life.","Your physical drive is strong & deep, providing lots of energy."]),t.s)
B.Gg=A.b(s(["The trait Loner is like a Single Star in the Night Sky that is far away from others. However, you are still shining in your own space. You do not need anyone.","A Loner Wolf is thought self-reliant and independent, yet is detached from its pack.","You enjoy being with people. However, Solitude is your comfort zone.","You might not be that flexible in extending or sharing your comfort zone with others.","It could be your strength if you know how to manage it."]),t.s)
B.Hh=A.b(s(["You have a strong anger at members of the opposite gender; while only being attracted to those who are a challenge.","Once the challenge is accomplished and you feel totally in control of a relationship, you will lose interest in the relationship / the task."]),t.s)
B.G0=A.b(s(["You have s a strong desire for change, for variety.","You have a desire to move about and not stay in any one place for long.","You desire to travel.","You usually enjoy travel shows.","You may be unable to travel; you don't like being tied down."]),t.s)
B.H7=A.b(s(["You are selective and careful in your choice of friends.","You accept very few people into your inner circle.","You evaluate people around you before you accept them as your friends.","You do not trust people easily.","You have a few selective friends that you can count on, those whom you truly trust on one hand and you probably won't need all the fingers."]),t.s)
B.Hf=A.b(s(["It frequently appears in teenagers' scripts usually beginning at the age of 12- 13 and disappearing somewhat around 17 or 18.","You go down into the physical area of your life and return to the past where you stay and do not come back to the line of reality, examining the past in the physical area (sex, body, activity, etc).","Until the early teenage years, youngsters have no interest in the opposite sex; yet all of a sudden normal biological urges begin to stir. Girls begin to notice the boys and the boys return their interest. The problem lies in what you do about these urges. First, you go into the past to find something that will tell you what to do. These problems are normally solved for you through education and marriage as you grow into young men and women. If the problem is solved, you'll see this teenage \u2018y\u2019 disappear from the writing.","So when I spot this y in the writing of a teenager, I know it is normal.","If It is in the writing of an adult, it\u2019s realized that you have never truly reached a balance between the physical and philosophical areas in your life."]),t.s)
B.Ha=A.b(s(['It communicates (about you) that:\n    \u25ab "I have many interests ".\n    \u25ab "I am attempting too many jobs at one time".\n    \u25ab "I scatter my energies".\n    \u25ab "I am constantly on the go and always looking for something new".',"You go in many directions at once and have so many things to do that you are confused."]),t.s)
B.HC=A.b(s(["You like to argue.","This trait will be enhanced if you also have analytical thinking patterns, irritation, sarcasm, stubbornness, or impulsiveness."]),t.s)
B.Ho=A.b(s(['Often you feel, "go-to-hell", to others.',"You resist other's authority."]),t.s)
B.Fz=A.b(s(["You have your own rate of progress.","You are a slow thinker.","You are deliberately slow to avoid mistakes.","You look for precision and exactness."]),t.s)
B.FM=A.b(s(["The domineering person intends to be the boss. You tend to assert your authority arrogantly.\n    \u25ab Your influence on others is short-lived.","You are always defending yourself.\n    \u25ab You feel the inability to control the situation and try to counteract your weakness by being bossy! To counteract the fear you use the defense mechanism, i.e. being domineering."]),t.s)
B.FD=A.b(s(['You fear that someone will say "no" to you.',"To get the approval of people, you can become a perfectionist because you fear others will laugh at you.","You may criticize others habitually, to create a more acceptable self-image, especially if you also have a low self-concept."]),t.s)
B.G5=A.b(s(["Embracing uniqueness is a beautiful quality, however, it should stem from genuine enjoyment rather than a need to prove something to others.","The desire to stand out can manifest in various ways, such as dressing differently, speaking uniquely, or distinctively presenting oneself.","This trait often develops during teenage years, driven by a strong desire to be noticed, and can sometimes be linked to artistic ability.","Being different is wonderful if it brings joy and aligns with one\u2019s natural preferences; however, it can become stressful if it arises from external pressure or expectations.","Recognizing the motive behind wanting to be different is crucial to ensure it fosters positivity and not stress or negative self-perception."]),t.s)
B.Gh=A.b(s(["You spend time putting everything in its place.","You review work in an attempt to make it precise."]),t.s)
B.Fj=A.b(s(["You are very witty with your words.","You being witty about others is enjoyable. However, if you are the subject, then it's not enjoyable. You might feel hurt."]),t.s)
B.G9=A.b(s(["You might not allow the right hand to know what's going on in the left hand...For example, you would never want the other person to know about your salary or about investments...!","The secretiveness relates to self, that there are certain personal things you don't intend anyone to know."]),t.s)
B.Fw=A.b(s(["This signifies the need to punish oneself.","You tend to be critical and sarcastic of yourself."]),t.s)
B.EH=A.b(s(["You are obsessively controlling an action."]),t.s)
B.Hx=A.b(s(["Your handwriting shows that there are moments when you tell yourself something that you very well know is not true for you. In a situation where money is the crucial factor for making a decision, you may say to yourself that money is not important to me. But inside you know that money is something that is a crucial factor in your decision-making.","Something is happening in your life that you don\u2019t want to accept and pacifying yourself by giving false assurances. For example, if a student has an exam and is not prepared for it and instead of taking action and studying, pacifying himself like the examiner will be lenient, exam will be easy, or at least I\u2019ll get passing marks.","There is a thin line between being optimistic and telling a lie to yourself as in this, you are not taking any action.","This trait can be corrected by Grapho-therapy. However, before this, do you want to share anything on this line, in which area of your life do you have this feeling?"]),t.s)
B.FU=A.b(s(["Stubbornness can be easily misunderstood.","Once, you make up your mind, you do not wish to be confused by more facts.","Being stubborn can act as a stabilizer."]),t.s)
B.HL=A.b(s(["You love to talk. Sometimes, you will talk just to hear your own voice.","Being talkative makes you avoid any conversation related to yourself."]),t.s)
B.Hi=A.b(s(["You pay more attention to details.","The more observant you are, therefore the better memory."]),t.s)
B.GB=A.b(s(["You have an attitude that you need to be important to many people."]),t.s)
B.EA=A.b(s(["This is a very valuable trait as it assists in the accomplishment of any goals that you establish as well as any goals you accept that have been established by others."]),t.s)
B.FT=A.b(s(["You have the ability to say things, in a way that other people want to hear.","You can also phrase touchy subjects in a nice informative format."]),t.s)
B.Gk=A.b(s(["There is a small story about the Dominant person \u2013 Put 5 men out to dig a ditch with no one in charge. Come back an hour later and you'll find that the one with a dominant personality would tell others how to do it. The other men having accepted him as their leader will be happily following orders."]),t.s)
B.FE=A.b(s(['Enthusiasm is the producer of confidence and generates that extra spark that makes you great.\n    \u25ab It says "Hey, I\'ve got what it takes!" without even uttering a word.',"Real enthusiasm is contagious.\n    \u25ab It rubs off on everyone it touches. Enthusiasm has a magnetism of projected energy that can be caught by anyone.","Enthusiasm Sells. It influences.",'More than any other trait, "Enthusiasm" is the companion of success.']),t.s)
B.EF=A.b(s(["What I can see in your handwriting is that you are a person whose ideas and thoughts can be conveyed easily from one topic to another. You are good orators and conversationalists.","You can express your ideas smoothly and easily, moving from one object to another with ease.","You make a good conversationalist, a speaker, or a writer."]),t.s)
B.EG=A.b(s(["You do not volunteer to give your opinion in the first place.","You will be honest and blunt when asked for an opinion.","If you are Talkative too, you will volunteer to give opinions even when not asked for."]),t.s)
B.FF=A.b(s(["You have long range plans. You are capable of seeing far into the future.","You plan 2, 3, 5 or even 10 years in advance.","It is a trait found in achievers."]),t.s)
B.Gi=A.b(s(["Loyalty supports a person's convictions \u2013 their philosophy and normally is a stabilizer. You are a person who is faithful to your ideals.","An extremely loyal person does not offer his friendship lightly or casually."]),t.s)
B.Hq=A.b(s(["This person has the ability to take things apart and put them back together.","They are very mechanically minded.","They have a good hand and mind co-ordination."]),t.s)
B.Hp=A.b(s(["You are a person who always looks at the brighter side of life.","This is a trait we would normally like to see in a person. You know that tomorrow will be better.","If enthusiasm is added to the optimism and if willpower is added to the optimism, it gives a much stronger combination."]),t.s)
B.Hd=A.b(s(["Ability to:\n    \u25ab Create smooth-running order out of chaos","Take a situation with a problem and smooth it out:\n    \u25ab Organize it to operate without hitches, complications, or bottlenecks"]),t.s)
B.Hc=A.b(s(["You have the quality of not giving up when confronted with temporary setbacks.","You will persist until the task is completed."]),t.s)
B.Gp=A.b(s(["You make statements with confidence and conviction.","You will act as if you know the right answer even when you are not sure."]),t.s)
B.H5=A.b(s(["You possess strong leadership qualities.","You rely on yourself & have a great amount of inner strength."]),t.s)
B.FV=A.b(s(["Willpower is a relative trait.","Your willpower is very strong when the project starts, however, as time passes by, it begins to weaken.","You progress towards a goal, and your willpower grows stronger. You love a challenge.","Dreamer + Enthusiasm + Will Power = Surprising Results"]),t.s)
B.EB=A.b(s(["You are not paying much attention to what you are doing; the mind is thinking of other things.","It means that you are not paying much attention to what you are doing; the mind is thinking of other things."]),t.s)
B.Hw=A.b(s(["You have been involved in physical activities earlier which have gone missing and the body craves for it.","You have to go back to doing more traveling, exercising, or sexual activity."]),t.s)
B.Gt=A.b(s(["What I see in your handwriting is that you have a fear of success. This means sometimes, you go too close to success but eventually fail because of the fear of change or discomfort. Because success needs and brings change and it might sometimes impact your comfort.","Example: If there is any event that's going against your comfort (mismatched time, distant place), you may want to skip it to avoid that discomfort zone. You might not be that flexible in extending or sharing your comfort zone with others.","The closer you come towards success and then turn away.","Once the feeling of dejection occurs, you will get very close to success and then fail."]),t.s)
B.HO=A.b(s(["Your handwriting shows you reliving past hurts and encompassing (surrounding) a great deal of imagination.","Eventually, you do come back to reality.","It means that you were very outgoing until someone criticized you and then withdrew into yourself."]),t.s)
B.FZ=A.b(s(["Your handwriting reveals hidden emotional discomfort causing stress and anger, which you rarely express.","This is like walking with a small stone in your shoe\u2014ignoring it may lead to deeper issues.","Handwriting analysis identifies these emotional triggers.","Grapho-Therapy helps overcome them subconsciously.","Resolving these will lead to calmness."]),t.s)
B.F8=A.b(s(["It is a fear of not being loved.","Either you overeat or don't eat at all. Again, either you sleep too much or don't sleep at all.","It is a feeling of insecurity.","You always want to be first.","Jealousy can be a spur to achievement."]),t.s)
