B.Gx=A.b(s(["Low Self-Esteem Traits: Fear of Failure, Self-Underestimation, and Fear of Disapproval lead to avoiding challenges and undervaluing oneself.","Self-Neglect: Often neglects health, appearance, and self-care.","Cannot Accept Compliments: Feels undeserving of praise or success.","Conditioned by Environment: Deeply influenced by upbringing or surroundings.","Holds onto the Past: Avoids change, clings to old jobs, relationships, or possessions.","People-Pleasing: Struggles to say no, prioritizing others at personal cost."]),t.s)
B.FW=A.b(s(["You want everyone to love you and to get approval from people, you would do everything possible.","You want everyone to love you, yet you think that everyone is against you.",'Your imagination is so large that you will listen to every conversation, recording it within your brain and later you would go over every word that has been said and ask yourself "What did he/she mean by that?" and you will add your imagination to understand.']),t.s)
B.FX=A.b(s(["Your handwriting reveals an area of life not aligning with your expectations\u2014health, relationships, or sexual life.","Health: You may feel discomfort without understanding the root cause.","Relationships: A lack of communication or unresolved issues may persist.","Physical Frustration: Indicates mental blocks affecting physical satisfaction.","Connectivity Missing: Suggests a gap causing frustration and imbalance."]),t.s)
B.Hb=A.b(s(["Your handwriting suggests a tendency to postpone unpleasant or unappealing tasks.","There is a lack of regard for time, often resulting in lateness and missed deadlines.","Despite good intentions, tasks are frequently delayed, with completion pushed until the last moment.",'Your handwriting suggests your wheels of the cycle are stuck in the mud. You are pedaling hard, however, unable to move forward. With Grapho-therapy, your subconscious can clear mental blocks, helping you clean the "mud" and progress smoothly in life.']),t.s)
B.Gz=A.b(s(["Your handwriting reveals suppressed emotions like anger, pain, regret, or guilt that resurface during discomfort, causing you to blame past circumstances or people for current challenges.","This behavior acts like a thorny weed, hindering emotional freedom, and well-being and sabotaging self-perception and social interactions.","With Grapho-therapy and lifestyle changes, you can reprogram your subconscious mind to overcome these old patterns and thrive."]),t.s)
B.G8=A.b(s(["Your handwriting suggests you tend to tune out topics that don't interest you, which might make others perceive you as rude or indifferent.","Filtering conversations to align with your beliefs can limit new perspectives and strain relationships, especially with family and partners.","By actively listening to others, you can build stronger connections, reduce stress, and open up opportunities for growth in both personal and professional life."]),t.s)
B.Ht=A.b(s(["A Glass Door in a Storm:\n    Just as a delicate glass door might not withstand the strong winds, similarly when you face harsh/strong comments, you become fragile and vulnerable, especially concerning your philosophical faith because that is your way of leading life, and one rough remark could shake the entire belief system you\u2019ve built which can lead to self-doubts and self-questioning later. One topic to another.","You are a good orator and conversationalist."]),t.s)
B.Fv=A.b(s(["Your handwriting suggests that you absorb others' opinions deeply, allowing criticism to impact your emotions, actions, and self-perception, leading to a loss of control.","Repeated sensitivity to criticism, whether constructive or destructive, creates patterns that undermine your empowerment and confidence.","You may require constant praise and validation to stay motivated and productive in your endeavors.","Struggles in teamwork may arise as you might perceive someone working against you, even without evidence.","By modifying your handwriting through Grapho-therapy, you can develop resilience, redefine your self-worth, and learn to treat criticism as growth-oriented feedback."]),t.s)
B.FQ=A.b(s(["Temper is an emotion, it is not anger.","You have it, however, you don't understand how to overcome a situation and end up reacting with a temper.","You, basically have an imbalance of emotions where you get excited very easily, irritated, or angry very easily."]),t.s)
